import request from '@/utils/request'; //查询派工单列表

export function searchRecords(query) {
  return request({
    url: '/mes/plan/work',
    method: 'get',
    params: query
  });
} //订单拆分生产派工单

export function splitRecord(data) {
  return request({
    url: '/mes/plan/work',
    method: 'post',
    data: data
  });
} //删除拆分订单

export function deleteRecord(productOrderCode) {
  return request({
    url: "/mes/plan/work/".concat(productOrderCode),
    method: 'delete'
  });
} //查询物料需求列表

export function queryRecordNeeds(workOrderCode) {
  return request({
    url: "/mes/plan/work/".concat(workOrderCode, "/needs"),
    method: 'get'
  });
} //强制完工

export function completeRecord(productOrderCode) {
  return request({
    url: "/mes/plan/work/".concat(productOrderCode, "/complete"),
    method: 'patch'
  });
}
